import Post from './Post'
import { useEffect } from 'react'

const Home = ({ postList, getAllPosts }) => {
  useEffect(() => {
    getAllPosts()
  }, [])

  return (
    <div>
      <div>
        <h1 className="text-blue">Hello World</h1>
      </div>
      <Post postList={postList} />
      <div className="cool-post-logo">
        <img src="" />
      </div>
    </div>
  )
}

export default Home
